//Connection to MQTT broker
void connectToBroker() {
	Serial.print("Attempting MQTT connection...");
	// Attempt to connect
	if (client.connect("WemosD1Mini_1")) {
		Serial.println("connected");
		// Once connected, publish an announcement...
		client.publish("WemosD1Mini_1/status", "WemosD1Mini_1 connected");
		// ... and resubscribe
		client.subscribe("WittyCloud1/temp");
		client.subscribe("BME280/temp");
		client.subscribe("BME280/humidity");
		client.subscribe("BME280/pressure");
		client.subscribe("ESP32_E_Paper_Screen/humidity");
		client.subscribe("ESP32_E_Paper_Screen/temperature");
	}
	else {
		Serial.print("failed, rc=");
		Serial.print(client.state());
		Serial.println(" try again in 60 seconds");
	}
}

