void getDTHSensorData() {
	unsigned long now = millis();
	if (now - lastGetSensorData > getSensorDataPeriod) {
		lastGetSensorData = now;
		Serial.println("Reading from DHT sensor!");
		float sensorHum = dht.getHumidity() - 6.0F;
		Serial.println(sensorHum);
		// Read temperature as Celsius (the default)
		float sensorTemp = dht.getTemperature();
		Serial.println(sensorTemp);
		// Check if any reads failed and exit early (to try again).
		if (isnan(sensorHum) || isnan(sensorTemp)) {
			Serial.println("Failed to read from DHT sensor!");
			return;
		}
		if (sensorHum != h || sensorTemp != t)
		{
			// redraw display only if data changed more then  0.1
			if (fabs(h - sensorHum) > 1 || fabs(t - sensorTemp) > 0.1)
			{
				h = sensorHum;
				t = sensorTemp;
				if (client.connected()) {
					publishSensorData();
				}
				drawDisplay();
			}
		}
	}
}

void callback(char* topic, byte* payload, unsigned int length) {
	Serial.print("Message arrived [");
	Serial.print(topic);
	Serial.print("] ");
  unsigned int i;
	for (i = 0; i < length; i++) {
		Serial.print((char)payload[i]);
	}
	Serial.println("-----");
	if (strcmp(topic, "WittyCloud1/temp") == 0) {
		char* buffer = (char*)payload;
		buffer[length] = '\0';
		float recieved = atof(buffer);
		if (fabs(outTemp1 - recieved) > 0.1)
		{
			outTemp1_prev = outTemp1;
			outTemp1 = recieved;
			drawDisplay();
		}
	}
	if (strcmp(topic, "BME280/temp") == 0) {
		char* buffer = (char*)payload;
		buffer[length] = '\0';
		float recieved = atof(buffer);
		if (fabs(bedRoomTemp - recieved) > 0.1)
		{
			outTemp2_prev = outTemp2;
			outTemp2 = recieved;
			drawDisplay();
		}
	}
	if (strcmp(topic, "BME280/humidity") == 0) {
		char* buffer = (char*)payload;
		buffer[length] = '\0';
		outHumidity = atof(buffer);
		drawDisplay();
		
	}
	if (strcmp(topic, "BME280/pressure") == 0) {
		char* buffer = (char*)payload;
		buffer[length] = '\0';
		float recieved = atof(buffer);
		addToPressureValues((int)recieved);
		if (fabs(pressure - recieved) > 1)
		{
			pressure = recieved;
			drawDisplay();
		}
	}
	if (strcmp(topic, "ESP32_E_Paper_Screen/humidity") == 0) {
		char* buffer = (char*)payload;
		buffer[length] = '\0';
		float recieved = atof(buffer);
		if (fabs(bedRoomHum - recieved) > 0.1)
		{
			bedRoomHum_prev = bedRoomHum;
			bedRoomHum = recieved;
			drawDisplay();
		}
	}
	if (strcmp(topic, "ESP32_E_Paper_Screen/temperature") == 0) {
		char* buffer = (char*)payload;
		buffer[length] = '\0';
		float recieved = atof(buffer);
		if (fabs(bedRoomTemp - recieved) > 0.1)
		{
			bedRoomTemp_prev = bedRoomTemp;
			bedRoomTemp = recieved;
			drawDisplay();
		}
	}
}

void setup() {
	populatePressureArr(993);
	Serial.begin(115200);
	display.init();
	display.fillScreen(GxEPD_WHITE);
	dht.setup(16);
	client.setServer(mqtt_server, 1883);
	client.setCallback(callback);
	startWiFi();
}

void loop() {		
	if (!client.connected()) {
		reconnectToBroker();
	}
	client.loop();
	getDTHSensorData();
}




